Luva de Vinil com Amido Volk 10 unidades Descrição:
Luva de segurança confeccionada em resina vinílica, não esterilizada, com pulverização interna de pó bioabsorvível (amido de milho); ambidestra, superfície externa lisa.
Uso: Descartável;
Formato: Ambidestro;
